            </div>
            <div className="noticeboard_text">
                <p className="noticeboard_title_p2">dssdfsdfsdfsdfsdfssdfsfsdfsdfsasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasfdfasdfasdfassㄴㅇㄹdfdf</p>
            </div>
        </div>
    );
  
  }


export default Noticeboard;
